import * as Linking from 'expo-linking';

export default {
  prefixes: [Linking.createURL('/')],
  config: {
    screens: {
      Root: {
        path: '/',
        screens: {
          Home: 'home',
          menu: {
            path: 'Menu',
            screens: {
              ViewMenu: 'ViewMenu',
              //ViewPerson: 'view',
              //EditPerson: 'edit',
            },
          },
          AddItemToOrder: 'AddItemToOrder',
          Order: 'Order',
          Help: 'help',
        },
      },
      NotFound: '*', // catch-all route (404 resource not found)
    },
  },
};

// PATH:    /people/view-all
// PATH:    /people/view
// PATH:    /people/edit
// PATH:    /people/add
